  return (
    <div className="App container">
      <div className="row">
      <Nav />
      <Project
        img="https://i.ebayimg.com/images/g/rkIAAOSw0mRggYOr/s-l500.jpg"
        alt="Shiba Inu Hello Kitty"
        name="Shiba Inu Hello Kitty"
       />
    </div>
    </div>
  );
}

export default App;
